2:3320:2175.docs:
Provides type based access to context intended for error reports.

Used in conjunction with [`Demand::provide_value`] and [`Demand::provide_ref`] to extract
references to member variables from `dyn Error` trait objects.

# Example

```rust
#![feature(provide_any)]
#![feature(error_generic_member_access)]
use core::fmt;
use core::any::Demand;

#[derive(Debug)]
struct MyBacktrace {
    // ...
}

impl MyBacktrace {
    fn new() -> MyBacktrace {
        // ...
        # MyBacktrace {}
    }
}

#[derive(Debug)]
struct SourceError {
    // ...
}

impl fmt::Display for SourceError {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        write!(f, "Example Source Error")
    }
}

impl std::error::Error for SourceError {}

#[derive(Debug)]
struct Error {
    source: SourceError,
    backtrace: MyBacktrace,
}

impl fmt::Display for Error {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        write!(f, "Example Error")
    }
}

impl std::error::Error for Error {
    fn provide<'a>(&'a self, demand: &mut Demand<'a>) {
        demand
            .provide_ref::<MyBacktrace>(&self.backtrace)
            .provide_ref::<dyn std::error::Error + 'static>(&self.source);
    }
}

fn main() {
    let backtrace = MyBacktrace::new();
    let source = SourceError {};
    let error = Error { source, backtrace };
    let dyn_error = &error as &dyn std::error::Error;
    let backtrace_ref = dyn_error.request_ref::<MyBacktrace>().unwrap();

    assert!(core::ptr::eq(&error.backtrace, backtrace_ref));
}
```

2:8957:2155.docs:
Returns the bounds on the remaining length of the iterator.

Specifically, `size_hint()` returns a tuple where the first element
is the lower bound, and the second element is the upper bound.

The second half of the tuple that is returned is an <code>[Option]<[usize]></code>.
A [`None`] here means that either there is no known upper bound, or the
upper bound is larger than [`usize`].

# Implementation notes

It is not enforced that an iterator implementation yields the declared
number of elements. A buggy iterator may yield less than the lower bound
or more than the upper bound of elements.

`size_hint()` is primarily intended to be used for optimizations such as
reserving space for the elements of the iterator, but must not be
trusted to e.g., omit bounds checks in unsafe code. An incorrect
implementation of `size_hint()` should not lead to memory safety
violations.

That said, the implementation should provide a correct estimation,
because otherwise it would be a violation of the trait's protocol.

The default implementation returns <code>(0, [None])</code> which is correct for any
iterator.

# Examples

Basic usage:

```
let a = [1, 2, 3];
let mut iter = a.iter();

assert_eq!((3, Some(3)), iter.size_hint());
let _ = iter.next();
assert_eq!((2, Some(2)), iter.size_hint());
```

A more complex example:

```
// The even numbers in the range of zero to nine.
let iter = (0..10).filter(|x| x % 2 == 0);

// We might iterate from zero to ten times. Knowing that it's five
// exactly wouldn't be possible without executing filter().
assert_eq!((0, Some(10)), iter.size_hint());

// Let's add five more numbers with chain()
let iter = (0..10).filter(|x| x % 2 == 0).chain(15..20);

// now both bounds are increased by five
assert_eq!((5, Some(15)), iter.size_hint());
```

Returning `None` for an upper bound:

```
// an infinite iterator has no upper bound
// and the maximum possible lower bound
let iter = 0..;

assert_eq!((usize::MAX, None), iter.size_hint());
```

2:8965:3066.docs:
Creates an iterator starting at the same point, but stepping by
the given amount at each iteration.

Note 1: The first element of the iterator will always be returned,
regardless of the step given.

Note 2: The time at which ignored elements are pulled is not fixed.
`StepBy` behaves like the sequence `self.next()`, `self.nth(step-1)`,
`self.nth(step-1)`, …, but is also free to behave like the sequence
`advance_n_and_return_first(&mut self, step)`,
`advance_n_and_return_first(&mut self, step)`, …
Which way is used may change for some iterators for performance reasons.
The second way will advance the iterator earlier and may consume more items.

`advance_n_and_return_first` is the equivalent of:
```
fn advance_n_and_return_first<I>(iter: &mut I, n: usize) -> Option<I::Item>
where
    I: Iterator,
{
    let next = iter.next();
    if n > 1 {
        iter.nth(n - 2);
    }
    next
}
```

# Panics

The method will panic if the given step is `0`.

# Examples

Basic usage:

```
let a = [0, 1, 2, 3, 4, 5];
let mut iter = a.iter().step_by(2);

assert_eq!(iter.next(), Some(&0));
assert_eq!(iter.next(), Some(&2));
assert_eq!(iter.next(), Some(&4));
assert_eq!(iter.next(), None);
```

